import { publicAxios as axios } from '../../axios';
import routes from '../../routes';
import getURLParams from '../../utils/getURLParams';

export const placeOrder = (payload) => {
    return axios({
        method: 'POST',
        url: `${routes.orderRoute}`,
        data: payload.data,
        headers: {
            Authorization: payload.auth.authToken,
        }
    })
}

export const getByPartCodeBulk = (payload) => {
    return axios({
        method: 'GET',
        url: `${routes.getByPartCodeBulk}/${payload.partCodes}`,
        headers: {
            Authorization: payload.auth.authToken,
        }
    })
}
